import React from "react"
import Karta from "./Karta"

class PrikazKarte extends React.Component{

    constructor(){
        super()
        this.state = {
            karta:"",
            projekcija:""
        }
    }

    componentDidMount(){
        this.setState({karta:this.props.state.karta})
        const config={
            headers: new Headers({'Authorization': 'Bearer ' + localStorage.getItem('jwt')},
                                  {'Access-Control-Allow-Methods':'GET'}),
          };

        fetch('http://localhost:8080/bioskop/projekcije/'+this.props.state.karta.projekcija,config)
            .then(res => res.json())
            .then(res => {
                console.log("Projekcija od servera: "+JSON.stringify(res))
                this.setState({
                    projekcija: res
                })
            })
    }

    render(){
        return(
            <div>
                <Karta users={this.props.users} cancel={this.props.cancel} state={this.state} />
                {this.state.karta}
            </div>
        )
    }
}

export default PrikazKarte
